import React from "react";
import Estilo from "../Hojas de Estilos/Inicio.css"
function Inicio(){
    return(
        <article className="articulo-inicio">
            <h1 className="eslogan-texto">Juntos hacia un futuro inclusivo y brillante.</h1>
        </article>
    );
}

export default Inicio;
